import React from 'react'

function Main() {
    return (
        <div>
            <h1>Welcome to Redux</h1>
        </div>
    )
}


const mapStateToProps = state => {
    return {
        userData: state?.user
    }
}

const mapDispatchToProps = dispatch => {
    return {
        fetchingData: dispatch(fetchingData())
    }
}

export default Main
